        self.botaoEnviar = Button(self.frameMenuJogo, text = "Enviar", font = ('gotham', 13, 'bold'), bg = '#11111f', fg = '#dddddd', activebackground = '#555566', activeforeground = '#7777ff', border = 0, command = lambda: self.enviaNumero(coorX, coorY))
